import React from 'react'
import { Text, View, StyleSheet } from 'react-native'

const SearchBar = () => {
    return (
        <View style={styles.background}>
            <Text>Search Bar</Text>
        </View>
    )
}

const styles = StyleSheet.create({
    background: {
        backgroundColor: '#F0EEEE'
    }
})

export default SearchBar
